const float stored_means[FEATURES] = {-0.0803405f,  0.0219474f,   0.811231f,   -3.31864f,   -1.54524f,    5.00093f,   0.541864f,    1.34551f,    30.7631f,   0.468949f,    12.1212f,    17.1013f};

